import React from 'react'

export default function Red() {
    const redStyle = {
        height: '250px',
        width: '250px',
        border: '1px solid red',
        backgroundColor: 'red',
    }
    const redinline ={
        height:'180px',
        width:'180px',
        backgroundColor: 'white',
        display: 'flex',
        justifyContent: 'center',
        alignItem:'center'
    }
    return (
        <div style ={redStyle}>
            <div style={redinline}>

            </div>
        </div>
    )
}
